import React from 'react';
import "./menu.css"

const Menu = () => {
    const menus = [
        {
            id: 1,
            title: "Home",
            url: "/home",
        },
        {
            id: 2,
            title: "User List",
            url: "/user-list",
        },
        {
            id: 3,
            title: "Post Log",
            url: "/post-log",
        },
        {
            id: 4,
            title: "Login",
            url: "/login",
        },
    ];
    return (
        <div>
            <ul className='menu'>
                {menus.map((menu) => {
                    return (
                        <li key={menu.id}>
                            <a href={menu.url}>{menu.title}</a>
                        </li>
                    );
                })}
            </ul>
        </div >
    );
}

export default Menu;
